import React, { useState } from "react";
import "./Contact.css";

export default function Contact()
{
    const [] = useState("");

    return(
        <div id = "contact-wrapper">
            <div id = "contact-title">Contact Us</div>
            <form id = "contact-form">
                <label htmlFor = "contact-name-field">Name</label>
                <br />
                <input id = "contact-name-field" class = "contact-wide-input" />
                <label htmlFor = "contact-email-field">Email</label>
                <br />
                <input id = "contact-email-field" class = "contact-wide-input" />
                <select htmlFor = "contact-status-field">What is your registration status?</select>
                <br />
                <input id = "contact-status-field" class = "contact-wide-input" />
                <label htmlFor = "contact-body-field">What is it that you would like to ask or let us know?</label>
                <br />
                <textarea id = "contact-body-field" class = "contact-wide-input" />
                <input type = "submit" id = "submit-button" />
            </form>
        </div>
    )
}
